import React from 'react';
const ProductsPage = () => {
   const products = [
     { id: 1,
       name: 'Nalgene Water Bottle - On the Fly', 
       price: 17.99 ,
    description: 'high-flow drinking spout thats easy to fill at the fountain or sink.',
    image: '/images/soft-trunk.jpg'
     },
    
   ];

   return (
     <div>
       <h1>Products</h1>
       <ul>
         {products.map((product) => (
           <li key={product.id}>
             {product.name} - ${product.price}
           </li>
         ))}
       </ul>
     </div>
   );
};
export default ProductsPage;
